import * as React from 'react';
import { StyleSheet, Text } from 'react-native';

export default function App() {
    return (
        <Text>
        Hi
        </Text>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
